const CardList = ({ cards, onCardClick }) => {
    return (
      <div className="card-list">
        {cards.map((card) => (
          <Card
            key={card.id}
            fruit={card.fruit}
            isFlipped={card.isFlipped}
            onClick={() => onCardClick(card.id)}
          />
        ))}
      </div>
    );
  };
  
  export default CardList;
